import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const users = useSelector(store => store.user)
  console.log(users)

  const showUsers = users.map((user) => {
    <div key={user.id}>
      {user.name}  
    </div>
  })

  return(
    <div>
      <showUsers/>
    </div>
  )
}

export default Users
